import React from 'react';
import { FaBeer, AiFillAlert } from 'react-icons/fa';

import {
    Navbar,
    NavbarBrand,

  } from "shards-react";

class Header extends React.Component{
  render() {
    return(
        <Navbar type="dark" theme="primary" expand="md">
         <NavbarBrand href="/"><strong>ConsiderIT </strong> <FaBeer></FaBeer></NavbarBrand>
        </Navbar>

    )
  }
}

export default Header;
